import {fileSnatcher} from '../App.js'

const fetchData=()=>{
        let something;
        console.log('fetch data method is working');
        fetch('http://localhost:9000')
        .then(response => response.json())
        .then(data =>{fileSnatcher(data)}).catch(error=>{console.log(error)
                });
//        export {something};
        }
export  {fetchData};
